import React from "react";
import Header from "./Header";
import Notes from "./Notes.jsx";
import Footer from "./Footer";
import note from "./note.js";

function App(){
    return (
        <div>
       <Header />

       {note.map(noteEntry => 
       <Notes 
       key={noteEntry.id}
       title = {noteEntry.title}
       content = {noteEntry.content}
        />
       )}
       
       <Footer />
       </div>
    );
}

export default App;
